  true,\n\t\"url\": null,\n\t\"notes\": \"Total Ozone Mapping Spectrometer (TOMS)instruments
  have been successfully flown in orbit aboard the Nimbus-7(Nov. 1978 - May 1993),
  Meteor-3 (Aug. 1991 - Dec. 1994), Earth Probe (July 1996 - current), and ADEOS (Sep.
  1996 - June 1997) satellites. Since last thirty years, TOMS data have been providing
  useful information related to the ozone depletion, recovery and global trend. The
  Earth Probe, Meteor-3 and Nimbus-7 Total Ozone Mapping Spectrometer (TOMS) data
  are currently reprocessed using version-8 algorithmn                  ( http://toms.gsfc.nasa.gov/version8/v8toms_atbd.pdf
  ). n                  n                  The TOMS version 8 daily Level-2 swath
  data product consists of total column ozone, aerosol index, and Lambertian effective
  surface reflectivity (Rayleigh corrected) at approximately 50x50 km resolution (at
  nadir). This product also contains some auxiliary derived and ancillary parameters
  including N-values, SO2 index, cloud fraction, cloud pressure, ozone below clouds,
  terrain height, geolocation, solar and satellite viewing angles, and data quality
  flags.n                  n                  These Level-2 data are stored in the
  EOS version of Hierarchical Data Format 5 (HDF-EOS5) and are available ( http://mirador.gsfc.nasa.gov/)
  from the Goddard Earth Sciences (GES) Distributed Active Archive Center (DAAC).
  n                  n                  TOMS Levle-3 (Global Gridded 1x1.25 deg) are
  also available from the GES DISC.n                  The GES DISC DAAC maintains
  an online Web-based browser for previewing then                  data, subsetting
  in ASCII format and downloading the data and images. The URLn                  for
  the TOMS browser is http://giovanni.gsfc.nasa.gov/toms/n                  n                   For
  more information regarding TOMS or other DAAC data sets pleasen                  visit
  the DAAC Home Page at http://disc.sci.gsfc.nasa.gov/acdisc/ , orn                  contact
  the DAAC Help Desk at:n                  n                  GSFC DAAC Help Deskn
  \                 NASA Goddard Space Flight Centern                  Code 610.2n
  \                 Greenbelt, MD 20771n                  n                  gsfc-help-disc@lists.nasa.govn
  \                 n                  TOMS data are produced by the Laboratory for
  Atmospheres at NASA Goddardn                  Space Flight Center (Code 613.1).
  The Version-8 Algorithm Theoretial Basisn                  Document (ATBD)is available
  from the TOMS siten                  http://toms.gsfc.nasa.gov/version8/v8toms_atbd.pdfn
  \                 n                  The Level-3 data from Nimbus-7 TOMS, Meteor-3
  TOMS, and Earth Probe TOMS are also made available from the Code 916 TOMS site in
  the ASCII format.n                  For detailed information about the TOMS instrument,
  data, and ozone see then                  TOMS official Home Page at: http://toms.gsfc.nasa.gov/\",\n\t\"owner_org\":
